import React, { useState } from 'react';

function Homepage() {
  const [setCount, count] = useState(0);

  return (
    <div>
      <a class="btn-floating btn-large waves-effect waves-light blue" onClick={() => setCount(count + 1)}><i class="material-icons">add</i></a>
      <span class="new badge" data-badge-caption="jobs">{count}sfd</span>
    </div>
  );
}

export default Homepage;
